//SPDX-License-Identifier:MIT
pragma solidity ^0.8.0;
contract User{
    
    enum Status {
        ok,
        notok
    }
    address public owner;

    Status public  currentStatus;
    constructor(){
        owner= (msg.sender);
    }

    function pay() public payable returns(Status){
        
        if((msg.value)>=2 ether){
            return Status.ok;
        }

        else{
            return Status.notok;
        }
    }
}

